  false,\n\t\"url\": null,\n\t\"notes\": \"nThe Central Asian Snow Cover from Hydrometeorological
  Surveys data are based on observations made by personnel for three river basins:
  Amu Darya, Sir Darya, and Naryn. These observations include end of month snow depth,
  snow density and snow water equivalent. Only snow depth is included for additional
  snow points measured by helicopter landings. Temporal coverage varies for each snow
  point, with the longest station record extending from 1932 through 1990. Data were
  provided to NSIDC by the State Hydrometeorological Service (Russian acronym SANIGMI)
  in Tashkent, Uzbekistan.Development of this data set was funded by the NOAA Environmental
  Services, Data, and Information Management (ESDIM) program, through the NOAA/NESDIS
  National Geophysical Data Center (NGDC).n\",\n\t\"license_title\": null,\n\t\"extras\":
